import React from 'react';
import Card from './Card';
import Sdata from './Sdata';

const Tvf = () => {
  return (
    <Card
      key={Sdata[1].id}
      simg={Sdata[1].simg}
      sname={Sdata[1].sname}
      stitle={Sdata[1].stitle}
      slink={Sdata[1].slink}
    />
  );
};

export default Tvf;
